                "ProfitRate": 25.00,
                "TermsOfProduction": "İdarece onaylanmış proje ve detaylarına göre; 75 mm´lik Duvar U-profillerinin (DU75) vida ve plastik dubel kullanılarak 60 cm aralıklarla taban ve tavana sabitlenmesi, DU75 ve yan duvarlara tutturulacak 75 mm´lik Duvar C-profillerinin (DC75) altına 75 mm´lik ses yalıtım bandının yapıştırılması, DC75 profillerinin kesilmesi, sırt sırta gelecek şekilde çift DC75 profilinin 40 cm aralıklarla DU75 profillerinin arasına geçirilmesi, 5 cm kalınlıkta 50-52 kg/m³ yoğunluğundaki taşyünü levhaların yerleştirilmesi ve 12,5 mm kalınlığındaki yangına dayanıklı alçı duvar levhasının ilk katının 25 mm’lik, ikinci katının 35 mm’lik (veya 38 mm’lik) borazan vidalarla DU75 ve DC75 profillerine sabitlenmesi, bu işlemin duvarın diğer yüzünde aynı şekilde yapılması, gerektiği durumlarda alçı duvar levhasının kesilerek ebatlanması, derz dolgu alçısı ile 3 mm’den fazla boşluklara ön dolgu yapılması; vida başlarının derz dolgu alçısıyla kapatılması, derz bandının alçı duvar levhası ek yerlerine yapıştırılması, bant üzerine derz dolgu alçısı uygulanması suretiyle bölme duvarın oluşturulması her türlü malzeme ve zayiatı, işçilik, işyerinde yükleme, yatay ve düşey taşıma, boşaltma ile müteahhit genel giderleri ve kârı dâhil, 1 m² fiyatı: \rÖLÇÜ: Projesindeki boyutlar üzerinden m² olarak hesaplanır.\rNOT: 0,50 m² den küçük boşluklar düşülmez.",
